"use strict";(self.webpackChunksoulmatters_ro=self.webpackChunksoulmatters_ro||[]).push([[9793],{9793:i=>{i.exports=JSON.parse('{"author":"Andra Cozma","date":"2015-11-27T18:12:50.000Z","slug":"ce-chitaieli-ce-galagie-soriceii","status":"publish","title":"Ce chi\u021b\u0103ieli, ce g\u0103l\u0103gie! \u0218oriceii!","excerpt":"Ei rod lumea de acolo, o rod \u0219i pe cea de aici. Sunt ni\u0219te \u0219oricei. Mi-au pl\u0103cut mult \u0219oriceii dar  ","article":"Ei rod lumea de acolo, o rod \u0219i pe cea de aici. Sunt ni\u0219te \u0219oricei. Mi-au pl\u0103cut mult \u0219oriceii dar iau tot \u0219i nu mai las\u0103 nimic \xeen urma lor. Sunt mul\u021bi \u0219i lacomi. Mi\u0219un\u0103 peste tot \u0219i nu-i po\u021bi st\xe2rpi.\\n\\n\xce\u021bi rod r\u0103bdarea, stomacul, por\u021bia de m\xe2ncare din fa\u021b\u0103 \u0219i hainele de pe tine. Chiar pierd \u0219i tov\u0103r\u0103\u0219iile dintre ei, c\u0103ci se mai rod \u0219i unii pe al\u021bii, c\xe2nd n-au ce m\xe2nca.\\n\\nDe fel, sunt prieteno\u0219i \xeentre ei. Atunci c\xe2nd au de toate. Oricum, fiecare \u0219oricel \xeen parte, ar trebui s\u0103 fie atent. Peste tot sunt pericole. Natura nu iart\u0103 nimic. \xcel poate \xeenh\u0103\u021ba pe oricare dintre ei, c\xe2t ar zice \u201echi\u021b!\u201d\\n\\nLa punct de cotitur\u0103, hopa \u0219i cursa! Ce spaim\u0103! Ce chi\u021b\u0103ieli, ce g\u0103l\u0103gie!\\n\\nPe c\xe2\u021biva, cursa nu i-a l\u0103sat din str\xe2mtori. La \xeenceput au fost dureri mici. Ulterior, din ce \xeen ce mai mari.\\n\\nL\u0103crim\xe2nd de durere \u0219i tremur\xe2nd de fric\u0103, ei strig\u0103 cu toat\u0103 puterea c\u0103tre ceilal\u021bi dar \xeen zadar. Vai! Ce chi\u021b\u0103ieli, ce g\u0103l\u0103gie!\\n\\n\u0218oriceii r\u0103ma\u0219i se prefac cumva \xeen lilieci \u0219i nu s-au mai uitat \xeen urm\u0103 dup\u0103 ceilal\u021bi. Cei prin\u0219i \xeen curs\u0103 nu mai puteau fi z\u0103ri\u021bi oricum. Ce mai conta acum?\\n\\nCei deveni\u021bi lilieci, erau ferici\u021bi \u0219i r\u0103suna tot codrul cu glasul lor. Ce chi\u021b\u0103ieli, ce g\u0103l\u0103gie!\\n\\nVor veghea de sus \u0219i vor v\xe2na tot ce prind c\u0103 mi\u0219un\u0103 pe jos. Tot ce e mai mic \u0219i mai slab dec\xe2t ei. Dup\u0103 festin, precum ni\u0219te puiu\u021bi nevinova\u021bi, se vor cuib\u0103ri la ad\u0103post, la s\xe2n de \u0219oricioaic\u0103.\\n\\nFerici\u021bi, ghiftui\u021bi, \u0219oriceii s-au preg\u0103tit de somn iar \u0219oricioaica i-a \u0219i adormit\u2026 lini\u0219te-i peste tot.\\n    ","previous":{"slug":"spre-echilibru","title":"Spre echilibru"},"next":{"slug":"picnic","title":"Picnic"}}')}}]);